-- First delete related data for test cycles
DELETE pb FROM performance_blocks pb
JOIN cycles c ON pb.cycleId = c.id
WHERE c.userId = 1 AND c.id != 60011 AND (
  c.title LIKE '%Test%' OR c.title LIKE '%Bulk%'
);

DELETE ci FROM checklist_items ci
JOIN cycles c ON ci.cycleId = c.id
WHERE c.userId = 1 AND c.id != 60011 AND (
  c.title LIKE '%Test%' OR c.title LIKE '%Bulk%'
);

DELETE t FROM tactics t
JOIN goals g ON t.goalId = g.id
JOIN cycles c ON g.cycleId = c.id
WHERE c.userId = 1 AND c.id != 60011 AND (
  c.title LIKE '%Test%' OR c.title LIKE '%Bulk%'
);

DELETE g FROM goals g
JOIN cycles c ON g.cycleId = c.id
WHERE c.userId = 1 AND c.id != 60011 AND (
  c.title LIKE '%Test%' OR c.title LIKE '%Bulk%'
);

-- Then delete the test cycles
DELETE FROM cycles 
WHERE userId = 1 AND id != 60011 AND (
  title LIKE '%Test%' OR title LIKE '%Bulk%'
);

